var companyList = [];

companyList.push(response_body);

done({"response_body": companyList, continue: true});

let req_body = request_vendor_body;
if(JSON.stringify(req_body.indexOf("financial_settings")) < 0) {
  req_body = JSON.parse(request_vendor_body);
	req_body.financial_settings = {};
}
done({
  request_vendor_body: req_body
});

var myConfig = configuration;
var myVendorPath = null;
var myCountryPath = null;
var country = request_parameters.country;

if (country === undefined || country === null )
{
	country = configuration.country; 

}	

if (country !== undefined && country !== null)
{
	switch (country)
	{
		case "CA":
			myVendorPath = "https://oauth.na.sageone.com/";
			myCountryPath = "ca";
			break;

		case "IE":	
		case "GB":
			myVendorPath = "https://app.sageone.com/oauth2/";
			myCountryPath = "uki";
			break;

		case "US":
			myVendorPath = "https://oauth.na.sageone.com/";
			myCountryPath = "us";
			break;

		case "FR":	
			myVendorPath = "https://oauth.eu.sageone.com/token";
			myCountryPath = "fr";
			break;	
		case "DE":
			myVendorPath = "https://oauth.eu.sageone.com/token";
			myCountryPath = "de";
			break;	
		case "ES":	
			myVendorPath = "https://oauth.eu.sageone.com/token";
			myCountryPath = "es";
			break;		
	}
}

myConfig.country = request_parameters.country;
myConfig["oauth.token.url"] = myVendorPath + "token"; 
myConfig["oauth.token.refresh_url"] = myVendorPath + "token"; 
myConfig["oauth.token.revoke_url"] = myVendorPath + "revoke";
myConfig['oauth.user.refresh_time'] = Date.now();
myConfig['oauth.user.refresh_interval'] = response_body.expires_in;
myConfig['resource_owner_id'] = response_body.resource_owner_id;
myConfig['base.url']='https://api.columbus.sage.com/' + myCountryPath + '/sageone';

done({
	"configuration": myConfig,
	"continue": true
});

var myParameters = request_parameters; 
myParameters.code = decodeURIComponent(request_parameters.code);

var myVendorPath ="nodata";

var country = request_parameters.country;

if (country === undefined || country === null )
{
	country = configuration.country; 

}	

if (country !== undefined && country !== null)
{
	switch (country)
	{
		case "CA":
			myVendorPath = "https://oauth.na.sageone.com/token";
			break;

		case 'IE':
		case "GB":
			myVendorPath = "https://app.sageone.com/oauth2/token";
			break;

		case "US":
			myVendorPath = "https://oauth.na.sageone.com/token";
			break;

		case "DE":
		case "FR":	
		case "ES":	
			myVendorPath = "https://oauth.eu.sageone.com/token";
			break;	

	}
}

done({
	"request_vendor_path": myVendorPath,
	"request_parameters": myParameters,
    "continue": true
});
